(13,NULL,'001','Appointment Cards','appointment-cards',NULL,'<p>Keep on schedule with our custom appointment cards! Ordering appointment card printing with 48HourPrint.com gives you peace of mind that you are receiving high quality printing at very affordable prices. Our custom appointment cards deliver more for your money and the convenience of online ordering. Appointment Cards are a perfect inexpensive reminder tool for marketing your business. In this busy world, scheduled appointments can get easily overlooked without a reminder. Use them to communicate with your patients or customers in a number of ways. Appointment cards serve as a reminder of their scheduled appointment date and quickly provide the contact information they need if they have questions or need to reschedule. Your patients or customers will appreciate this takeaway they can reference at anytime. Appointment cards are perfect for financial and insurance professionals, salons and spas, as well as doctors, dental professionals, chiropractors, therapists, pet care professionals, and others. Preserving the environment is important to 48HourPrint.com. Our appointment cards - including two-sided appointment cards - are printed on recycled paper. Recycled paper is our standard stock, at no extra cost to you. This gives you great appointment card printing results on paper that is brighter and more uniform in color. All of our appointment card printing is full color on both sides and printed on 100# opaque smooth uncoated cover stock.</p>','products/jBX8eAxTnZeufdvkN1vXQvK3GSf3fRjgmjM1jI4T.png',50,50.00,0.00,NULL,1,NULL,NULL,NULL,NULL,0.00,'oz','2018-09-02 07:32:26','2018-09-02 08:11:25'),
(14,NULL,'002','Booklets','booklets',NULL,'<h2>Deliver a Professional Presentation With Booklet Printing</h2>\r\n\r\n<p>Your business deserves high-quality booklet printing that is memorable and informational. Our online booklet printing services make it easy and affordable to order booklets for all of your marketing needs. Our 48 Hour Turnaround Guarantee means you begin spreading the word in no time at all! Booklets provide an effective way to communicate key messages. Highlight the products you offer with enough space to explain them all in detail, or market your services and include customer testimonials. Create an informational packet for customers or employees. Bring your business to life by including employee bios and a brief company history. Anything you need to convey to your customers, clients, or employees can be conveniently arranged in a cost-effective booklet. Consider making customer keepsakes that include your branding throughout. Turn your booklet into a journal, calendar of events, or picture book that recipients will want to hold on to. Pass them out along with printed bookmarks and branded magnets. Include booklets in a pocket folder and distribute them before a presentation. We have lots of great booklet marketing ideas, as well as easy-to-use booklet templates for your convenience.</p>','products/a5vQTxpmOdJ9OjjzywJgDsLoWgddp37RBtMpaSct.png',5,50.00,0.00,40.00,1,NULL,NULL,NULL,NULL,0.00,'oz','2018-09-02 08:14:36','2018-09-03 03:17:02'),
(15,NULL,'003','Vinyl Banners','vinyl-banners',NULL,'<h2>Vinyl Banner Printing: Make a Big Visual Impact for a Steal</h2>\r\n\r\n<p>Vinyl banner printing gives you a ton of flexibility for any event, even outdoors. Custom banner printing is the go-to solution for advertising at trade shows, conventions, real estate developments, and outdoor political and business advertisements. But thanks to their wide range of options they work well in all these situations and more, such as in permanent exhibits, as decor, for smaller personal events such as birthday parties, or as a business sign for pop-up stores and food trucks. Vinyl banner sizes range from 3&rsquo; x 2&rsquo; to 5&rsquo;. x 10&rsquo;, making them suitable for any of the previously mentioned applications. Vinyl banners come in durable 13 and 15 oz. white vinyl, as well as a lightweight 9. oz mesh vinyl. Use the heavier grade white vinyl stocks for long-term displays and the lighter mesh vinyl stock for lighter banners that are designed for windy conditions. All of our vinyl banners are water resistant, and wind slits can be added to relieve wind stress as well. Mounting options include grommets and pole pockets. Grommets are metal eyelets that let you thread ropes or hooks into your banner, while pole pockets are narrow compartments for sliding poles into for easy hanging. To print vinyl banner designs, simply upload your artwork, or use our design tool. You can also use our banner template signs in both horizontal and vertical orientations to ensure that your artwork is in the safe zone and that all bleeds and trims are accounted for. Be sure to check our banner order pages for incredible deals and custom banner printing discounts. Read this article on banner sizes to learn more about the which design specs will best suit your needs. Start vinyl banner printing today.</p>','products/O3958FNx9IOqTnnizHpW2gg00LV9iyXeqkkxPoAy.png',10,50.00,0.00,NULL,1,NULL,NULL,NULL,NULL,0.00,'oz','2018-09-02 09:14:33','2018-09-02 09:32:49'),
(16,NULL,'004','Bookmarks','bookmarks',NULL,'<h2>Bookmark printing lets you leave a mark!</h2>\r\n \r\nBookmark 48HourPrint.com for high quality bookmark printing at prices you can afford! You can trust our online bookmark printing services for excellent quality and fast results with our industry-leading 48 Hour Turnaround Guarantee for quantities up to 5,000 bookmarks and our 24 Hour Turnaround Guarantee for quantities fewer than 500 bookmarks printed on our digital press.\r\n\r\nBookmarks are a universal favorite and display messages in a compact, useful way.Use online bookmark printing from 48HourPrint.com to give your message staying power. As a promotional piece, bookmarks can provide years of service - noting a readerâs place in a new novel or marking a favorite spot in a treasured book or helpful reference manual. Whether your bookmark includes a calendar or inspirational message, announces special events, or simply includes useful tips and facts, bookmark printing is an effective, low-cost way to promote businesses of all sizes, schools, colleges, libraries, bookstores, non-profits and more!\r\n\r\nPreserving the environment is important to 48HourPrint.com. Our bookmarks are printed on recycled cover stock, which delivers excellent results on cover stock that is brighter and more uniform in color. Recycled cover stock is our standard stock, at no extra cost to you. Our online bookmark printing services include full color both sides on 14 point cover stock, with your choice of gloss coating, high-gloss U.V. coating, C1S (coating on one side) or matte coating.\r\n\r\nFor tips on using promotional bookmarks, check out our bookmark marketing ideas. Also review our bookmark templates for layout guidelines that will help keep your print job on schedule.','products/7291ZgK0LPj1wqYxlr9oj2Oy9X72TSFq80o0J1zJ.jpeg',50,45.00,0.00,NULL,1,NULL,NULL,NULL,NULL,0.00,'oz','2018-09-02 09:53:35','2018-09-02 09:53:35'),
(17,NULL,'005','Brochures','brochures',NULL,'<p>High-Quality Brochures Printed in No Time Brochure printing is an affordable but effective promotional strategy for both small and big businesses. You can highlight idyllic tourist spots in travel brochures or introduce wedding packages with photographs of your previous couples. Use Folding to Break Down or Highlight Information We let you choose from eight standard folding options that present information in an organized yet detailed manner. Customers will breeze through your material once you print brochures in the size and fold. All the sizes we mention below and on the calculator measure the brochure before folding. Two-Panel Fold Brochure Printing Half Fold / Single Fold This fold divides your paper into two panels or two equal halves. Use this to list down your company&rsquo;s product or service information. The smallest popular size before folding is 5.5&rdquo; x 8.5&rdquo; and the largest is at 11&rdquo; x 17&rdquo;. Three-Panel Folds There are three kinds of three-panel folds. Each presents a unique way to reveal either step-by-step or visual-heavy information about your brand. The smallest most popular size before folding is at 8.5&rdquo; x 11&rdquo; but you can have a slightly larger one at 8.5&rdquo; x 14&rdquo;. The biggest size available for brochure printing is at 11&rdquo; x 17&rdquo;. Brochure Printing Trifold / Letterfold The most popular and versatile brochure fold is divided into three panels. They are ideal for marketing presentations that need to reveal information in a sequence. Brochure Printing Roll Fold The roll fold, as the name implies, folds your paper inward to itself. It lets you reveal each panel one by one or unveil organized information in a total of four interior panels. Brochure Printing Gate Fold This fold divides your brochure into three panels. Two panels appear like doors that cover a bigger central panel, enticing customers to unfold a revelation about a new store branch or product. Four-Panel Folds We offer the following four-panel folds. The additional fold provides more space either for another section or for more space to a large, visual-heavy layout. The most popular four-panel size before folding is at 8.5&rdquo; x 14&rdquo;. Brochure Printing Double Gate Fold Similar to the gate fold, this type has the central panel folded at the center. It offers a wide space for brochure designs that want to highlight colors, images, or require more text space. Brochure Printing Double Parallel Fold This fold divides your paper into four panels. It is first folded in half and then in half again, parallel to the first fold. This fold is great for detailed product and service presentations. Brochure Printing Accordion Fold This fold divides your brochure into four alternating panels. The design divides the page into six panels, each of which have ample space for detailed images and lengthier text. Brochure Printing French Fold The French fold divides your paper horizontally and then vertically into four quadrants. It&rsquo;s perfect for massive sized designs such as maps or image-heavy or infographics-based layouts. Brochure Paper Options Our paper stock options highlight the visual strengths of your design and entice potential customers to keep reading. The 70 lb. or 80 lb. paper stock is easy to carry and hand out at an event. The 100 lb. is more durable and ideal for a luxury market. A gloss coating best suits images with bright colors, while matte coating has no glare and is ideal for text-heavy brochures. Use our online design tool, Create 48 or upload your own design so that your order can be ready for shipping after one business day. Our free proofing service lets you check the file before the brochure actually prints. Start creating your promotional tool with us today. Additional Resources: Online Brochure PrintingBrochure Marketing Mailings Q&amp;A What is the difference between flat size and folded size? Flat size refers to the brochure before folding. As its name indicates, the folded size is how the brochure measures after folding. What are the best uses for the 70 lb. Text, 80 lb. Text, 100 lb. Text, and 100 lb. Cover? 70 lb. Text is bright white, uncoated paper that is excellent for writing and is 3.5 times heavier than regular copy paper. 80lb. Text is an economical, lightweight coated paper suitable for distribution and handing out at an event. 100lb. Text is a thick, premium coated paper with greater durability. The brochure is more likely to have less creases and no tears even after being stored in the receiver&#39;s bag. 100lb. Cover is the thickest cardstock and material available. It is recommended for those who want a premium finish and high-end look to their brochure. What is the advantage of UV coating? UV coating gives a high gloss finish to the surface it is applied to, enhancing the depth of color and making the hues pop. It also provides moisture and abrasion resistance. This is recommended for brochures that will be heavily handled by several individuals or will go through locations. What does &ldquo;printing turnaround&rdquo; mean? &ldquo;Printing turnaround&rdquo; is the number of days required to produce your order. It does not include shipping transit time, weekends and holidays. Printing turnaround starts once a print-ready file has been uploaded to a paid order. If you have requested a PDF or hard-copy proof, turnaround will begin once you have approved the proof.</p>','products/uEfWWjNlx2SRxS0VOqWTT8FXypBzgwrxKDDs1P4f.png',4,60.00,0.00,NULL,1,NULL,NULL,NULL,NULL,0.00,'oz','2018-09-02 11:11:12','2018-09-02 11:12:13'),
(18,NULL,'006','Buckslips','buckslips',NULL,'<p>Slip in a strong offer with buckslip printing When the situation calls for buckslips, you can trust 48HourPrint.com to complete your buckslip printing perfectly. We deliver high quality buckslip printing at very affordable prices &mdash; and more for your buck. Our online buckslip printing services also come with an industry-leading 48 Hour Turnaround Guarantee for quantities of 5,000 or fewer buckslips and our 24 Hour Turnaround Guarantee for quantities fewer than 500 buckslips printed on our digital press. Buckslip printing is a perfect way to promote an offer or special deal in your regular mailing to customers. Include a timely offer or two in the same package as your monthly billing invoice, often without additional postage costs. Whether you want to stimulate renewals, promote a year-end sale, or introduce a new product, buckslip printing is the perfect medium.You can also partner with a company that provides complementary services, using buckslips to promote each other&rsquo;s company. Buckslips are lightweight and an easy and effective way to reach your target audience. Preserving the environment is important to 48HourPrint.com. Recycled paper is our standard stock, at no extra cost to you. This delivers excellent buckslip printing results on paper that is brighter and more uniform in color. We offer both one-sided buckslip printing and two-sided buckslip printing in two sizes - 3.5&rdquo; x 8.5&rdquo; and 4&rdquo; x 9&rdquo; - printed on 100# text stock, with your choice of gloss coating, matte coating, or U.V. coating. For promotional tips on using buckslips, check out our buckslip marketing ideas. And review our buckslip templates for layout guidelines that will keep your print job on schedule.</p>','products/fMaZ66vEWj34w0rJdbO4HFfPvTY8TOZSmOhPFhr5.png',2,50.00,0.00,NULL,1,NULL,NULL,NULL,NULL,0.00,'oz','2018-09-02 11:15:25','2018-09-02 11:15:47'),
(19,NULL,'007','Die-Cut Business Cards','die-cut-business-cards',NULL,'<p>Die-Cut Business Card Printing: Give Your Business a Lift Classic business cards have their place, but for making lasting first impressions, or showing a new brand direction, custom die-cut business card printing is the way to go. Rounded corners and custom shapes can give a fun feel and help your brand become easier to remember. We offer a range of options to help your cards stand out. Choose from business card shapes like rounded corners, leaf-shaped cards, single rounded corner, half-circle side, oval, and circle. Print die-cut business cards on thick 14 pt. or premium 16 pt. stock with your choice of gloss, high gloss, or matte coating. These custom shapes and stock options can match your brand or create a striking visual effect. No matter the size of your business, you can print die-cut business cards that suit your needs. Print as few as 25 unique shaped business cards for select clients and prospects or as many as as 10,000 for supplying entire sales departments in one order, all in as little as 48 hours.</p>','products/gcQsslrVrCGpFHC5BVcePcJVljUWiSzIwlWG1xtW.png',4,50.00,0.00,NULL,1,NULL,NULL,NULL,NULL,0.00,'oz','2018-09-02 12:58:13','2018-09-02 12:58:41');
